import React from 'react';
import styled from 'styled-components'

const StyledSlideOne = styled.div`
  .background-top {
    backgorund: #FAC943;
  }
  .background-bottom {
    background: #FFFFFF;
  }
`;

function SlideOne() {
  return (
    <div className="slide-one">
      <div className='background-top'/>
      <div className='background-bottom' />
    </div>
  );
}

export default SlideOne;
